    await loadFull(engine);
  };

  const particlesLoaded = async (container) => {
    // You can perform additional actions here after particles are loaded.
    console.log(container);
  };

  useEffect(() => {
    // Do any other setup or initialization here if needed.
  }, []);

  return (
    <Particles
      id="particles"
      options={{
        // Configure your particle animation options here
      }}
      init={particlesInit}
      loaded={particlesLoaded}
    />
  );
}

export default ParticleComponent;
